import React, { Component } from 'react';
import PropTypes from 'prop-types';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

export class Activity extends Component {

    render() {
        const { id, text, icon } = this.props.data;
        return (
            <div className="d-flex mb-2 justify-content-between">
                <button onClick={this.props.setSelected.bind(this, id)} type="button" className="btn btn-default btn-circle btn-xl"><p>{ data.text }</p><FontAwesomeIcon icon={ data.icon } size="2x"/></button>
            </div>
        )
    }
}

export default Activity;
